import { Typography } from "@mui/material";
import "./Pageone.css";
import React from "react";
import Rectangle37 from "../assets/Rectangle37.png";
function Pageone() {
  return (
    <div className="banner">
     
        <Typography sx={{fontSize:'40px'}}>
          We ensure and transform 
          <br/>
          business growing
        </Typography>
 
    </div>
  );
}

export default Pageone;
